import ApiService from "./apiService";

const API_KEY = '22eea4bc4e844a8a972c0abf537b6bc4';
const API_URL = 'https://newsapi.org/v2/';

export default class NewsService extends ApiService {
    constructor() {
        super(API_URL);
    }

    getHeadlines(country = 'us') {
        const url = `top-headlines?country=${country}&apiKey=${API_KEY}`;

        return this.get(url);
    }
}
